import moment from 'moment';

const Posts = (props) => {
    const posts = props.posts;
    const body = posts[0].body;
    const user_id = posts[0].user_id['id']
    const name = posts[0].user_id['first_name'] + ' ' +posts[0].user_id['last_name'];
    const date = moment(posts[0].date_created.fromNow());
  return (
    <Fragment>
      <div className="form-group">
        <h1>User ID: {user_id}</h1>
        <h4>{name}</h4>
        <h5>Post: {body}</h5>
        <h6></h6>
      </div>
    </Fragment>
  );
};
export default Posts;
